// the object stores the accumulated losses in each economy due to recession
var losses;

var propagationLevel;

// the function propogates the effects of changes in the source economy to trade partners
// "source" is a source country's code (string)
// "loss" is a loss in source country's economy (float)
function propagate(source, loss, level) {
	//record down the loss of the source economy
	losses[source] += loss;
	//if loss is significnat
	if (level < propagationLevel) {
		var nextLevel = level+1;		
		var links = matrix[source];
		for (var key in links) {
			//caulculate the loss for each partner and propagate further
			var parnterLoss = links[key]*loss;
			propagate(key, parnterLoss, nextLevel);
		}
	}
}

