// the function populates the elements on the page on first load
function loadPage() {
	
	html = "";
	var source = document.getElementById("source");
	for(var key in code2name) {
		if (key == "USA") {
			html += "<option value="+ key +" selected>" + code2name[key] + "</option>";
		} else {
			html += "<option value="+ key +">" + code2name[key] + "</option>";
		}
	}
	source.innerHTML = html;
	
	fetch('world.json').then((r) => r.json()).then((data) => {
		mapCountries = ChartGeo.topojson.feature(data, data.objects.countries).features;
	});
	
	myMap = new Chart(document.getElementById("canvas").getContext("2d"), {
		type: 'choropleth',
		data: {
			labels: [],
			datasets: [{
				label: 'Countries',
				data: [],
			}]
		},
		options: {
			showOutline: true,
			showGraticule: false,
			plugins: {
				legend: {
					display: false
				},
			},
			scales: {
				xy: {
					projection: 'geoEquirectangular'
				}
			}
		}
	});
}

// the function shows the results of a simulation
function showResults(source) {
	
	var sourceEconomy = {
		name: code2name[source],
		code: source,
		loss: Number((losses[source]*100).toFixed(2))
	};
	var otherEconomies = [];
	
	for(var key in losses) {
		if (key != source) {
			var loss = Number(Number(losses[key]*100).toFixed(2));
			//var loss = Number(losses[key]*100);
			if (loss > 0) {
				var economy = {
					name: code2name[key],
					code: key,
					loss: loss
				};
				otherEconomies.push(economy);
			}
		}
	}
	
	otherEconomies.sort((a, b) => parseFloat(b.loss) - parseFloat(a.loss));
	//console.log(otherEconomies);
	
	var result = document.getElementById("result");
	var html = "";
	//html += "<tr><th>Countries</th><th>Reduction in GDP due to global recession</th></tr>";
	
	html += "<tr>";
		html += "<td class='mdl-data-table__cell--non-numeric'><strong>Source economy</strong></td>";
		html += "<td class='mdl-data-table__cell--non-numeric'><strong>Country code</strong></td>";
		html += "<td class='mdl-typography--text-right'><strong>Loss in source economy (including feedback effects)</strong></td>";
	html += "</tr>";
	html += "<tr>";
		html += "<td class='mdl-data-table__cell--non-numeric'>"+sourceEconomy.name+"</td>";
		html += "<td class='mdl-data-table__cell--non-numeric'>"+sourceEconomy.code+"</td>";
		html += "<td>"+sourceEconomy.loss+"%</td>";
	html += "</tr>";
	html += "<tr>";
		html += "<td class='mdl-data-table__cell--non-numeric'><strong>Affected economies</strong></td>";
		html += "<td class='mdl-data-table__cell--non-numeric'><strong>Country code</strong></td>";
		html += "<td class='mdl-typography--text-right'><strong>Reduction in growth in affected economies</strong></td>";
	html += "</tr>";
	
	var n = otherEconomies.length;
	
	for(var i = 0; i < n; i++) {
		html += "<tr>";
			html += "<td class='mdl-data-table__cell--non-numeric'>"+otherEconomies[i].name+"</td>";
			html += "<td class='mdl-data-table__cell--non-numeric'>"+otherEconomies[i].code+"</td>";
			html += "<td>"+otherEconomies[i].loss+"%</td>";
		html += "</tr>";
	}
	
	result.innerHTML = html;
		
	var labels = [];
	var data = [];
	for(var key in losses) {
			var economy = mapCountries.find((d) => d.id == code2mapid[key]);
			var loss = losses[key];
			
			var nation = {
				value: loss*100,
				feature: economy
			};

			data.push(nation);
			labels.push(economy.properties.name);
	}
	
	myMap.data.labels = labels;
	myMap.data.datasets[0].data = data;
	
	myMap.color = 'rgba(0,0,0,1)';	
	myMap.update();	

}


